import React, { useState } from 'react';
import axios from 'axios';
import '../styles/components/pages/ContactoPage.css';


const ContactoPage = () => {
  const [formData, setFormData] = useState({
    nombre: '',
    email: '',
    telefono: '',
    mensaje: ''
  });

  const [msg, setMsg] = useState('');
  const [sending, setSending] = useState(false);

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setSending(true);
    setMsg('');

    try {
      const response = await axios.post('http://localhost:3001/api/contact', formData);
      if (response.data.ok) {
        setMsg('Mensaje enviado correctamente ‚úÖ');
        setFormData({ nombre: '', email: '', telefono: '', mensaje: '' });
      } else {
        setMsg(response.data.msg || 'Error al enviar ‚ùå');
      }
    } catch (error) {
      console.error(error);
      setMsg('Error de conexi√≥n con el servidor ‚ùå');
    } finally {
      setSending(false);
    }
  };

  return (
    <main className="contacto-container">
      <section className="contacto-card">
        <h2 className="contacto-titulo">Contacto R√°pido</h2>

        <form className="formulario" onSubmit={handleSubmit}>
          <div className="campo">
            <label htmlFor="nombre">Nombre</label>
            <input
              type="text"
              name="nombre"
              value={formData.nombre}
              onChange={handleChange}
              placeholder="Tu nombre"
            />
          </div>

          <div className="campo">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="correo@ejemplo.com"
            />
          </div>

          <div className="campo">
            <label htmlFor="telefono">Tel√©fono</label>
            <input
              type="text"
              name="telefono"
              value={formData.telefono}
              onChange={handleChange}
              placeholder="Tu tel√©fono"
            />
          </div>

          <div className="campo">
            <label htmlFor="mensaje">Mensaje</label>
            <textarea
              name="mensaje"
              rows="4"
              value={formData.mensaje}
              onChange={handleChange}
              placeholder="Escrib√≠ tu mensaje..."
            />
          </div>

          <button type="submit" className="btn-enviar" disabled={sending}>
            {sending ? 'Enviando...' : 'Enviar'}
          </button>

          {msg && <p className="msg">{msg}</p>}
        </form>
      </section>

      <section className="contacto-info">
        <h2>Otras v√≠as de comunicaci√≥n</h2>
        <p>Tambi√©n puede contactarse con nosotros usando los siguientes medios:</p>
        <ul>
          <li>üìû Tel√©fono: 4324-2499</li>
          <li>üìß Email: contacto@transpore.com.ar</li>
          <li>üí¨ Facebook</li>
          <li>üê¶ Twitter</li>
          <li>üìû Skype</li>
        </ul>
      </section>
    </main>
  );
};

export default ContactoPage;
